transitionTypes.preface:
local sum(arr, n) =
if (n <= 0) then 0
else sum(arr, n-1) + arr[n-1];
local calculateActivityContribution(entry) = if std.objectHas(entry, 'climateChange') then
entry.climateChange else entry.amount * entry.emissionFactor;
local activityContributions = std.map(calculateActivityContribution, input_values);
local climateChange = sum(activityContributions,std.length(activityContributions));
local findInstanceToken(token) = std.objectHas(token, 'instanceID');
local instanceToken = std.filter(findInstanceToken, input_values)[0];
// displayed visualisations and indicators
local assembleContributions(index, element) = if !std.objectHas(element, '$visualisations')
then
if std.objectHas(element, 'instanceID')
then []
else [{ name: input_names[index], value: activityContributions[index] }]
else element['$visualisations'][1]['value'][0]['children'];
local contributionArrays = std.mapWithIndex(assembleContributions, input_values);
local returnElement(element) = element;
local contributions = std.flatMap(returnElement, contributionArrays);
local visualisations =  [
{
'type': 'number',
'unit': 'kg CO2e',
'description': 'THG-Fussabdruck',
'value': climateChange
},
{
'type': 'sunburst',
'unit': 'kg CO2e',
'description': 'THG-Beiträge (Sunburst)',
'value': [{
'name': 'Scope 2',
'children': contributions
}]
}
];

